import React, { Component } from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { robots } from "./robots";

const state = {
  robots: { robots },
  searchField: "",
};

class App extends Component {
  render() {
    return (
      <main>
        <header className="tc">
          <h1>Robo Friends App</h1>
          <SearchBox />
        </header>
        <section>
          <CardList robots={robots} />;
        </section>
      </main>
    );
  }
}

export default App;
